== Merger ==

The [[16th Bombardment Squadron]], Very Heavy and the 916th Air Refueling Squadron were consolidated in 1985 and should have a single article.
In the normal course of merging, the old article becomes a redirect to the merged article.  It seems to me that there is no edge in notablility for the 16th BS, VH over the [[16th Bombardment Squadron (Light)]].  I would therfore propose making [[16th Bombardment Squadron]] a disambiguation page and creating [[16th Bombardment Squadron, Very Heavy]] as a redirect to this page.  If there is an objection to forming a disambiguation page with only two pages, I suppose No. 16 (Bomber) Squadron, RAF could be added. --[[User:Lineagegeek|Lineagegeek]] ([[User talk:Lineagegeek|talk]]) 20:20, 15 May 2014 (UTC)

